import React, { Component } from "react";
import deleteImage from'./delete.png';

class SearchMovies extends Component {
  render() {
    return (
      <div>
        <h2>Search Movies</h2>

        <img src="Project-Three/images/delete.jpg" alt="Delete"></img>

        <a href="https://www.w3schools.com">
<img border="0" alt="W3Schools" src="Project-Three/images/delete.jpg" width="100" height="100"></img>
      </a>
      </div>
    );
  }
}

export default SearchMovies;
